import banner from '../../assets/banner.jpg';



function Home(props) {


  return(
    <>

      <section className="banner-section mb-5">
        <img src={banner} className="img-fluid" alt="RD Mobile Accessories and Audio"/>
      </section>

    </>
  );

}

export default Home;
